css:
.tab {
    overflow: hidden;
    border: 1px solid #ccc;
    background-color: #f1f1f1;
}

/* Style the buttons that are used to open the tab content */
.tab button {
    background-color: inherit;
    float: left;
    border: none;
    outline: none;
    cursor: pointer;
    padding: 14px 16px;
    transition: 0.3s;
}

/* Change background color of buttons on hover */
.tab button:hover {
    background-color: #ddd;
}

/* Create an active/current tablink class */
.tab button.active {
    background-color: #ccc;
}

/* Style the tab content */
.tabcontent {
    display: none;
    padding: 6px 12px;
    border: 1px solid #ccc;
    border-top: none;
}

//=============================================

.benefits_list {
    list-style-type: disc;
    columns: 2;
    list-style-position: inside;
}

hr {
    display: block;
    margin-before: 0.5em;
    margin-after: 0.5em;
    margin-start: auto;
    margin-end: auto;
    border-style: inset;
    border-width: 1px; 
}

label[class*="pb-label"] {
    color: black;
    font-weight: normal;
}

/* Formatting summary line items */
div[id*="summary_"] {
     margin-left: 8%;
     display: grid;
     grid-template-columns: 20% 10%;
}

div[id*="summary_"] > span {
     text-align: right;
}

/* Formatting subtotal line items */
div[id*="subtotal"] {
     margin-left: 5%;
     display: grid;
     grid-template-columns: 30% 10%;
}

div[id*="subtotal"] > span {
     text-align: right;
}

.filterText {
    padding-top: 10px;
    padding-bottom: 10px;
    font-weight: normal;
}

table {
    border: 1px solid black;
}

th, td {
    padding: 5px;
    //text-align: left;
   border: 1px solid black;
}

tr:nth-child(even) {
     background-color: #f2f2f2;
}



/* The Modal (background) */
.modal {
    display: none; /* Hidden by default */
    position: fixed; /* Stay in place */
    z-index: 1; /* Sit on top */
    left: 0;
    top: 0;
    width: 100%; /* Full width */
    height: 100%; /* Full height */
    overflow: auto; /* Enable scroll if needed */
    background-color: rgb(0,0,0); /* Fallback color */
    background-color: rgba(0,0,0,0.4); /* Black w/ opacity */
}

/* Modal Content/Box */
.modal-content {
    background-color: #fefefe;
    margin: 15% auto; /* 15% from the top and centered */
    padding: 20px;
    border: 1px solid #888;
    width: 80%; /* Could be more or less, depending on screen size */
}

/* The Close Button */
.close {
    color: #aaa;
    float: right;
    font-size: 28px;
    font-weight: bold;
}

.close:hover,
.close:focus {
    color: black;
    text-decoration: none;
    cursor: pointer;
}
